  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1992, the Habitat Ecology team has
  been conducting fishery independent, visual surveys of demersal fishes and associated
  habitats in deep water (20 to 900 meters) off California, using manned submersibles,
  remotely-operated vehicles, and towed cameras equipped with video cameras, lasers,
  and CTD. This relational database contains information on counts, sizes, species
  and habitat types of demersal fishes, corals, and sponges, and location and amount
  of area surveyed. \",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
